import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Route,
    Link,
    NavLink
} from 'react-router-dom'
import Menu from "./Components/Menu";
import Progress_bar from "./Components/Progress_bar";


class App extends Component {
  render() {
    return (
        <Router>
            <div>
              <Progress_bar/>
              <Menu/>
            </div>
        </Router>
    );
  }
}

export default App;
